(2, 3, 2, ': aggiunta nuova nota.', '2022-02-10 10:21:55', '2022-02-09 12:56:38', '2022-02-10 10:21:55'),
(3, 55, 55, 'non riusciamo ad inserire SHAKUN OLESIA E SONIA, l\'applicativo restituisce un errore con la dicitura.. i datti delle persone sono già inseriti, non è vero!! la famiglia è parzialmente inserita ci sono solo ANDRII NATALIA ED OLENA , come possiamo procedere?', '0000-00-00 00:00:00', '2022-06-30 14:34:15', '2022-06-30 14:34:15'),
(4, 55, 55, 'IN MANCANZA DI UN CUI O DI UN ID VESTANET NON POSSONO COESISTERE DUE BENEFICIARI CON STESSI DATI.  IL MESSAGGIO DI ERRORE COMPARE ATTUALMENTE A N. 26 OSPITI DA REGISTRARE, NON CAPIAMO IL MESSAGGIO, NON RIUSCIAMO A PROCEDERE NEL CARICAMENTO DEI SUDDETTI , POTETE SUPPORTARCI ?  CELLULARE 346 5040041', '0000-00-00 00:00:00', '2022-08-31 17:41:36', '2022-08-31 17:41:36');
