(945, 1, 1, '{\"open\":true,\"primary\":true,\"layout\":\"single\",\"visibility\":{\"visibility_by_component\":false,\"components\":[]},\"title\":\"Sezione\",\"subtitle\":\"\",\"color\":\"#193e1c\",\"items\":[],\"questions\":[{\"type\":\"image\",\"label\":\"Immagine\",\"icon\":\"<i class=\'fa fa-picture-o\'><\\/i>\",\"path\":\"2022\\/11\\/63693175be412_prefetto.png\",\"caption\":\"\",\"preview\":true,\"conditioned\":false,\"connected_to\":\"\",\"show_on\":\"\",\"visible\":true,\"show_in_table\":false,\"label_table\":\"\",\"show_in_export\":false,\"label_export\":\"\",\"layout_alignment\":\"left\",\"id\":1666709674666},{\"type\":\"answer_text_editor\",\"label\":\"Compilabile\",\"icon\":\"<i class=\'fa fa-edit\'><\\/i>\",\"question\":\"\",\"tooltip\":\"\",\"answer\":\"<p>&nbsp;<\\/p>\\n<table style=\\\"border-collapse: collapse; width: 100%; border-style: none;\\\" border=\\\"0\\\" cellpadding=\\\"4\\\">\\n<tbody>\\n<tr>\\n<td style=\\\"width: 50%;\\\">Prot. N <span style=\\\"background-color: #f1c40f;\\\">XXXX<\\/span>\\/<span style=\\\"background-color: #f1c40f;\\\">XXX<\\/span>\\/Area IV<\\/td>\\n<td style=\\\"width: 50%; text-align: right;\\\">Torino, <span style=\\\"background-color: #f1c40f;\\\">DATA PROT<\\/span><\\/td>\\n<\\/tr>\\n<\\/tbody>\\n<\\/table>\\n<p>&nbsp;<\\/p>\",\"preview\":true,\"conditioned\":false,\"connected_to\":\"\",\"show_on\":\"\",\"visible\":true,\"required\":false,\"show_in_table\":false,\"label_table\":\"\",\"show_in_export\":false,\"label_export\":\"\",\"layout_alignment\":\"right\",\"id\":1667744827934},{\"type\":\"answer_text_editor\",\"label\":\"Compilabile\",\"icon\":\"<i class=\'fa fa-edit\'><\\/i>\",\"question\":\"\",\"tooltip\":\"\",\"answer\":\"<p>&nbsp;ATTESO che nell&rsquo;ambito delle procedure di accoglienza dei migranti sbarcati sulle coste italiane &egrave; stato trasferito in questa provincia il\\/la cittadino\\/a {{ospite_cognome}} {{ospite_nome}}, nato il {{ospite_data_nascita}} in {{ospite_luogo_nascita}}, {{ospite_vestanet}}, <span style=\\\"background-color: #f1c40f;\\\">unitamente ai componenti del nucleo famigliare che seguono XXXXXX<\\/span><\\/p>\\n<div>&nbsp;CONSIDERATO che il <span style=\\\"background-color: #f1c40f;\\\">predetto migrante\\/nucleo<\\/span> richiedente protezione internazionale &egrave; stato assegnato presso la struttura temporanea denominata {{ente_denominazione}} sita in {{struttura_indirizzo}}, ai sensi dell&rsquo;art. 11 del D.Lgs 142\\/2015;<\\/div>\\n<div>&nbsp;<\\/div>\\n<div><span style=\\\"font-size: 11.0pt;\\\">PRESO ATTO che <span style=\\\"background-color: #f1c40f;\\\">il\\/la<\\/span> responsabile della citata struttura di accoglienza, <span style=\\\"background: yellow; mso-highlight: yellow;\\\">RESPONSABILE ENTE GESTORE<\\/span>, con nota datata <span style=\\\"background: yellow; mso-highlight: yellow;\\\">DATA NOTA<\\/span> che fa parte integrante del presente provvedimento, ha comunicato che il suddetto richiedente ha abbandonato la struttura senza preventiva e motivata comunicazione a questa Prefettura U.T.G. e a tutt&rsquo;oggi non vi ha fatto rientro;<\\/span> <!-- [if gte mso 9]><xml>\\n <w:WordDocument>\\n  <w:View>Normal<\\/w:View>\\n  <w:Zoom>0<\\/w:Zoom>\\n  <w:TrackMoves\\/>\\n  <w:TrackFormatting\\/>\\n  <w:HyphenationZone>14<\\/w:HyphenationZone>\\n  <w:PunctuationKerning\\/>\\n  <w:ValidateAgainstSchemas\\/>\\n  <w:SaveIfXMLInvalid>false<\\/w:SaveIfXMLInvalid>\\n  <w:IgnoreMixedContent>false<\\/w:IgnoreMixedContent>\\n  <w:AlwaysShowPlaceholderText>false<\\/w:AlwaysShowPlaceholderText>\\n  <w:DoNotPromoteQF\\/>\\n  <w:LidThemeOther>IT<\\/w:LidThemeOther>\\n  <w:LidThemeAsian>X-NONE<\\/w:LidThemeAsian>\\n  <w:LidThemeComplexScript>AR-SA<\\/w:LidThemeComplexScript>\\n  <w:Compatibility>\\n   <w:BreakWrappedTables\\/>\\n   <w:SnapToGridInCell\\/>\\n   <w:WrapTextWithPunct\\/>\\n   <w:UseAsianBreakRules\\/>\\n   <w:DontGrowAutofit\\/>\\n   <w:SplitPgBreakAndParaMark\\/>\\n   <w:EnableOpenTypeKerning\\/>\\n   <w:DontFlipMirrorI