di-font-style: normal;\\\">abbandono del centro di accoglienza da parte del richiedente, senza preventiva e motivata comunicazione alla prefettura- UTG competente..&rdquo;<\\/em>;<\\/span><\\/p>\\n<p class=\\\"MsoFooter\\\"><span style=\\\"font-size: 11.0pt;\\\">VISTO il decreto legislativo n. 25 del 2008;<\\/span><\\/p>\\n<p class=\\\"MsoFooter\\\"><span style=\\\"font-size: 11.0pt;\\\">VISTO il decreto legislativo n.142 del 2015;<\\/span><\\/p>\\n<p class=\\\"MsoFooter\\\"><span style=\\\"font-size: 11.0pt;\\\">VISTA la circolare del Ministero dell&rsquo;Interno, Dipartimento per le Libert&agrave; Civili e<span style=\\\"mso-spacerun: yes;\\\">&nbsp;&nbsp; <\\/span><\\/span><\\/p>\\n<p class=\\\"MsoFooter\\\"><span style=\\\"font-size: 11.0pt;\\\">l&rsquo;Immigrazione n. 2255 del 30.10.2015<\\/span><\\/p>\\n<p class=\\\"MsoFooter\\\"><span style=\\\"font-size: 11.0pt;\\\">CONSIDERATO che il presente provvedimento costituisce atto dovuto e non discrezionale per l&rsquo;adozione del quale si omette la comunicazione prevista dagli artt. 7 e 8 della Legge 241\\/90;<\\/span><\\/p>\\n<p class=\\\"MsoFooter\\\"><span style=\\\"font-size: 11.0pt;\\\">&nbsp;<\\/span><\\/p>\\n<p class=\\\"MsoFooter\\\" style=\\\"text-align: center;\\\" align=\\\"center\\\"><span style=\\\"font-size: 11.0pt;\\\">DISPONE<\\/span><\\/p>\",\"preview\":true,\"conditioned\":false,\"connected_to\":\"\",\"show_on\":\"\",\"visible\":true,\"show_in_table\":false,\"label_table\":\"\",\"show_in_export\":false,\"label_export\":\"\",\"layout_alignment\":\"right\",\"id\":1670855542016},{\"type\":\"answer_text_editor\",\"label\":\"Compilabile\",\"icon\":\"<i class=\'fa fa-edit\'><\\/i>\",\"question\":\"\",\"tooltip\":\"\",\"answer\":\"<p><!-- [if gte mso 9]><xml>\\n <w:WordDocument>\\n  <w:View>Normal<\\/w:View>\\n  <w:Zoom>0<\\/w:Zoom>\\n  <w:TrackMoves\\/>\\n  <w:TrackFormatting\\/>\\n  <w:HyphenationZone>14<\\/w:HyphenationZone>\\n  <w:PunctuationKerning\\/>\\n  <w:ValidateAgainstSchemas\\/>\\n  <w:Save