\/td>\\n<\\/tr>\\n<tr>\\n<td style=\\\"width: 40%;\\\">&nbsp;<\\/td>\\n<td style=\\\"width: 10%; vertical-align: top; text-align: right;\\\">e, p.c&nbsp;<\\/td>\\n<td style=\\\"width: 50%; text-align: left;\\\">All\'ente gestore {{ente_denominazione}}<br \\/>{{ente_indirizzo}} <br \\/>{{ente_email}}<\\/td>\\n<\\/tr>\\n<tr>\\n<td style=\\\"width: 40%;\\\">&nbsp;<\\/td>\\n<td style=\\\"width: 10%;\\\">&nbsp;<\\/td>\\n<td style=\\\"width: 50%; text-align: left;\\\">Alla Questura di Torino<br \\/>Ufficio Immigrazione<\\/td>\\n<\\/tr>\\n<tr>\\n<td style=\\\"width: 40%;\\\">&nbsp;<\\/td>\\n<td style=\\\"width: 10%;\\\">&nbsp;<\\/td>\\n<td style=\\\"width: 50%; text-align: left;\\\">Al Dirigente del Servizio I<\\/td>\\n<\\/tr>\\n<tr>\\n<td style=\\\"width: 40%;\\\">&nbsp;<\\/td>\\n<td style=\\\"width: 10%;\\\">&nbsp;<\\/td>\\n<td style=\\\"width: 50%; text-align: left;\\\">Alla Commissione Territoriale per il Riconoscimento della Protezione Internazionale<\\/td>\\n<\\/tr>\\n<tr>\\n<td style=\\\"width: 40%;\\\">&nbsp;<\\/td>\\n<td style=\\\"width: 10%;\\\">&nbsp;<\\/td>\\n<td style=\\\"width: 50%; text-align: left;\\\">Alle Questure e alle Prefetture della Repubblica<\\/td>\\n<\\/tr>\\n<tr>\\n<td style=\\\"width: 40%;\\\">&nbsp;<\\/td>\\n<td style=\\\"width: 10%;\\\">&nbsp;<\\/td>\\n<td style=\\\"width: 50%; text-align: left;\\\">All\'Anagrafe del Comune di {{struttura_comune}}<\\/td>\\n<\\/tr>\\n<\\/tbody>\\n<\\/table>\",\"preview\":true,\"conditioned\":false,\"connected_to\":\"\",\"show_on\":\"\",\"visible\":true,\"show_in_table\":false,\"label_table\":\"\",\"show_in_export\":false,\"label_export\":\"\",\"layout_alignment\":\"right\",\"id\":1670340616571},{\"type\":\"answer_text_editor\",\"label\":\"Compilabile\",\"icon\":\"<i class=\'fa fa-edit\'><\\/i>\",\"question\":\"\",\"tooltip\":\"\",\"answer\":\"<div style=\\\"text-align: justify;\\\">\\n<p>&nbsp; &nbsp; &nbsp; &nbsp; <strong>OGGETTO<\\/strong>: revoca per allontanamento volontario a norma dell\'art. 23 del Decreto legislativo 18 agosto 2015, n. 142 del Sig.{{ospite_cognome}} {{ospite_nome}},&nbsp; nato il {{ospite_data_nascita}} in&nbsp; &nbsp; {{ospite_luogo_nascita}}, VESTANET {{ospite_vestanet}}, CUI {{ospite_cui}}<\\/p>\\n<p><strong>&nbsp; &nbsp; &nbsp;Provvedimento di revoca delle misure di accoglienza.<\\/strong><\\/p>\\n<\\/div>\",\"preview\":true,\"conditioned\":false,\"connected_to\":\"\",\"show_on\":\"\",\"visible\":true,\"required\":false,\"show_in_table\":false,\"label_table\":\"\",\"show_in_export\":false,\"label_export\":\"\",\"layout_alignment\":\"right\",\"id\":1670340965209},{\"type\":\"answer_text_editor\",\"label\":\"Compilabile\",\"icon\":\"<i class=\'fa fa-edit\'><\\/i>\",\"question\":\"\",\"tooltip\":\"\",\"answer\":\"<p style=\\\"text-align: justify;\\\">Si trasmette il provvedimento indicato in oggetto con preghiera di provvedere alla notifica ed alla esecuzione del medesimo nelle forme e modalit&agrave; previste dalla legge.<\\/p>\\n<p style=\\\"text-align: justify;\\\">La Commissione Territoriale per il Riconoscimento della Protezione Internazionale &egrave; cos&igrave; resa edotta del provvedimento adottato, per quanto disciplinato dall&rsquo;articolo 23-bis del D.Lgs. 25\\/2008.<\\/p>\\n<p style=\\\"text-align: justify;\\\">L&rsquo;Ente Gestore e il Dirigente di questo Servizio I, per le rispettive competenze, sono cos&igrave; resi edotti del provvedimento adottato.<\\/p>\",\"preview\":true,\"conditioned\":false,\"connected_to\":\"\",\"show_on\":\"\",\"visible\":true,\"required\":false,\"show_in_table\":false,\"label_table\":\"\",\"show_in_export\":false,\"label_export\":\"\",\"layout_alignment\":\"right\",\"id\":1670341253965},{\"type\":\"answer_text_editor\",\"label\":\"Compilabile\",\"icon\":\"<i class=\'fa fa-edit\'><\\/i>\",\"question\":\"\",\"tooltip\":\"\",\"answer\":\"<p>&nbsp;<\\/p>\\n<table style=\\\"border-collapse: collapse; width: 100%; border-style: none; word-wrap: break-word;\\\" border=\\\"0\\\" cellpadding=\\\"4\\\">\\n<tbody>\\n<tr>\\n<td style=\\\"width: 55%;\\\">&nbsp;<\\/td>\\n<td style=\\\"width: 45%; text-align: center;\\\">IL DIRIGENTE DELL&rsquo;AREA IV<\\/td>\\n<\\/tr>\\n<tr>\\n<td style=\\\"width: 55%; text-align: center;\\\"><span style=\\\"background-color: #f1c40f;\\\">Sigla della persona che ha fatto la nota<\\/span><\\/td>\\n<td style=\\\"width: 45%; text-align: center;\\\">(<span style=\\\"background-color: #f1c40f;\\\">NOME DIRIGENTE area IV<\\/span>)<\\/td>\\n<\\/tr>\\n<\\/tbody>\\n<\\/table>\",\"preview\":true,\"conditioned\":false,\"connected_to\":\"\",\"show_on\":\"\",\"visible\":true,\"required\":false,\"show_in_table\":false,\"label_table\":\"\",\"show_in_export\":false,\"label_export\":\"\",\"layout_alignment\":\"right\",\"id\":1670341316572}]}', '#e2dff5', '63b567c1bce130.20680178', 1, '2023-01-04 12:38:13', '2023-01-04 12:38:13');
