(966, 2, 1, '{\"open\":true,\"primary\":true,\"layout\":\"single\",\"visibility\":{\"visibility_by_component\":false,\"components\":[]},\"title\":\"Sezione\",\"subtitle\":\"\",\"color\":\"#e2fe7f\",\"items\":[],\"questions\":[{\"type\":\"image\",\"label\":\"Immagine\",\"icon\":\"<i class=\'fa fa-picture-o\'><\\/i>\",\"path\":\"2022\\/11\\/6369173c12c55_prefetto.png\",\"caption\":\"\",\"preview\":true,\"conditioned\":false,\"connected_to\":\"\",\"show_on\":\"\",\"visible\":true,\"show_in_table\":false,\"label_table\":\"\",\"show_in_export\":false,\"label_export\":\"\",\"layout_alignment\":\"left\",\"id\":1666876054546},{\"type\":\"answer_text_editor\",\"label\":\"Compilabile\",\"icon\":\"<i class=\'fa fa-edit\'><\\/i>\",\"question\":\"\",\"tooltip\":\"\",\"answer\":\"<p>&nbsp;<\\/p>\\n<table style=\\\"border-collapse: collapse; width: 100%; border-style: none;\\\" border=\\\"0\\\" cellpadding=\\\"4\\\">\\n<tbody>\\n<tr>\\n<td style=\\\"width: 50%;\\\">Prot. N <span style=\\\"background-color: #f1c40f;\\\">XXXX<\\/span>\\/<span style=\\\"background-color: #f1c40f;\\\">XXX<\\/span>\\/Area IV<\\/td>\\n<td style=\\\"width: 50%; text-align: right;\\\">Torino, <span style=\\\"background-color: #f1c40f;\\\">DATA PROT<\\/span><\\/td>\\n<\\/tr>\\n<\\/tbody>\\n<\\/table>\\n<p>&nbsp;<\\/p>\",\"preview\":true,\"conditioned\":false,\"connected_to\":\"\",\"show_on\":\"\",\"visible\":true,\"required\":false,\"show_in_table\":false,\"label_table\":\"\",\"show_in_export\":false,\"label_export\":\"\",\"layout_alignment\":\"right\",\"id\":1667745338390},{\"type\":\"answer_text_editor\",\"label\":\"Compilabile\",\"icon\":\"<i class=\'fa fa-edit\'><\\/i>\",\"question\":\"\",\"tooltip\":\"\",\"answer\":\"<p>ATTESO che nell&rsquo;ambito delle procedure di accoglienza dei migranti sbarcati sulle coste italiane &egrave; stato trasferito in questa provincia il\\/la cittadino\\/a {{ospite_cognome}} {{ospite_nome}}, nato il {{ospite_data_nascita}} in {{ospite_luogo_nascita}},&nbsp; Vestanet{{ospite_vestanet}}, CUI {{ospite_cui}}, <span style=\\\"background-color: #f1c40f;\\\">unitamente ai componenti del nucleo famigliare che seguono XXXXXX<\\/span><\\/p>\\n<div>&nbsp;CONSIDERATO che il <span style=\\\"background-color: #f1c40f;\\\">predetto migrante\\/nucleo<\\/span> richiedente protezione internazionale &egrave; stato assegnato presso la struttura temporanea denominata {{ente_denominazione}} sita in {{struttura_indirizzo}}, ai sensi dell&rsquo;art. 11 del D.Lgs 142\\/2015;<\\/div>\\n<div><br \\/><br \\/><\\/div>\",\"preview\":true,\"conditioned\":false,\"connected_to\":\"\",\"show_on\":\"\",\"visible\":true,\"required\":false,\"show_in_table\":false,\"label_table\":\"\",\"show_in_export\":false,\"label_export\":\"\",\"layout_alignment\":\"right\",\"id\":1670856084686},{\"type\":\"answer_text_editor\",\"label\":\"Compilabile\",\"icon\":\"<i class=\'fa fa-edit\'><\\/i>\",\"question\":\"\",\"tooltip\":\"\",\"answer\":\"<div>&nbsp; &nbsp; &nbsp;PRESO ATTO che il gestore della citata struttura di accoglienza con nota datata<span style=\\\"background-color: #ffdd00;\\\"> DATA NOTA<\\/span> che fa parte integrante del presente provvedimento, ha comunicato che, a seguito del rigetto al ricorso presentato a <span style=\\\"background-color: #f1c40f;\\\">TIPOLOGIA ORGANO<\\/span>,&nbsp; il suddetto richiedente ha manifestato la volont&agrave; di reiterare la richiesta di protezione internazionale, e pertanto, non ha pi&ugrave; titolo a permanere nella succitata struttura in quanto sono venute meno le condizioni che hanno determinato il diritto all&rsquo;accoglienza;<\\/div>\",\"preview\":true,\"conditioned\":false,\"connected_to\":\"\",\"show_on\":\"\",\"visible\":true,\"required\":false,\"show_in_table\":false,\"label_table\":\"\",\"show_in_export\":false,\"label_export\":\"\",\"layout_alignment\":\"right\",\"id\":1667745408614},{\"type\":\"fixed_text\",\"label\":\"Testo fisso\",\"icon\":\"<i class=\'fa fa-align-left\'><\\/i>\",\"value\":\"<div>&nbsp; &nbsp; &nbsp;RITENUTO che si siano verificate le condizioni previste dal comma 1 lettera c dell&rsquo;art. 23 del D.Lgs 142\\/2015, che prevede, tra l&rsquo;altro, la revoca delle misure di accoglienza nel caso di: &ldquo;presentazione di una domanda reiterata ai sensi dell&rsquo;art. 29 del decreto legislativo 28 gennaio 2008, n. 25, e successive modificazioni&rdquo;;<\\/div>\\n<div>&nbsp; &nbsp; &nbsp;VISTO il decreto legislativo n. 25 del 2008;<\\/div>\\n<div>&nbsp; &nbsp; &nbsp;VISTO il decreto legislativo n.142 del 2015;<\\/div>\\n<div>&nbsp; &nbsp; &nbsp;VISTA la circolare del Ministero dell&rsquo;Interno, Dipartimento per le Libert&agrave; Civili e&nbsp; l&rsquo;Immigrazione n. 2255 del 30.10.2015<\\/div>\\n<div>&nbsp;<\\/div>\\n<div>&nbsp; &nbsp; &nbsp;CONSIDERATO che il presente provvedimento costituisce atto dovuto e non discrezionale per l&rsquo;adozione del quale si omette la comunicazione prevista dagli artt. 7 e 8 della Legge 241\\/90;<\\/div>\\n<div>&nbsp;<\\/div>\\n<div style=\\\"text-align: center;\\\">DISPONE<\\/div>\",\"preview\":true,\"conditioned\":false,\"connected_to\":\"\",\"show_on\":\"\",\"visible\":true,\"show_in_table\":false,\"label_table\":\"\",\"show_in_export\":false,\"label_export\":\"\",\"layout_alignment\":\"right\",\"id\":1667745483258},{\"type\":\"answer_text_editor\",\"label\":\"Compilabile\",\"icon\":\"<i class=\'fa fa-edit\'><\\/i>\",\"question\":\"\",\"tooltip\":\"\",\"answer\":\"<p class=\\\"MsoFooter\\\" style=\\\"text-indent: 0cm;\\\"><span style=\\\"font-size: 11.0pt;\\\">Per i motivi indicati in premessa, la revoca della misura di accoglienza nei confronti di&nbsp;<\\/span>{{ospite_cognome}} {{ospite_nome}}, nato il {{ospite_data_nascita}} in {{ospite_luogo_nascita}<span style=\\\"font-size: 11.0pt;\\\">; Vestanet<\\/span>{{ospite_vestanet}}, CUI {{ospite_cui}} <span style=\\\"background-color: #f1c40f;\\\">e del nucleo famigliare<\\/span><\\/p>\\n<p class=\\\"MsoFooter\\\" style=\\\"text-indent: 0cm;\\\"><span style=\\\"font-size: 11.0pt;\\\">Il presente provvedimento di revoca ha effetto dal momento della sua comunicazione all&rsquo;interessato\\/i, ai sensi dell&rsquo;art. 23, comma 5 del D.Lgs 18.08.2015, n. 142, ovvero dall&rsquo;assolvimento delle procedure di notifica presso il luogo di domicilio ex art. 5, commi 1 e 2 del D.Lgs 142.<\\/span><\\/p>\\n<p class=\\\"MsoFooter\\\" style=\\\"text-indent: 0cm;\\\"><span style=\\\"font-size: 11.0pt;\\\">Il presente provvedimento &egrave; comunicato altres&igrave; al gestore della struttura di accoglienza, il quale, in caso di ricomparsa dell&rsquo;interessato, provveder&agrave; a consegnargliene copia.<\\/span><\\/p>\\n<p class=\\\"MsoFooter\\\" style=\\\"text-indent: 0cm;\\\"><span style=\\\"font-size: 11.0pt;\\\">Il presente provvedimento sar&agrave; trasmesso alle Prefetture e alle Questure presenti sul territorio nazionale e alla competente Commissione Territoriale per il riconoscimento della protezione internazionale.<\\/span><\\/p>\\n<p class=\\\"MsoFooter\\\" style=\\\"text-indent: 0cm;\\\"><span style=\\\"font-size: 11.0pt;\\\">Avverso il presente provvedimento &egrave; ammesso ricorso al Tribunale Amministrativo Regionale di Torino, nel termine di sessanta giorni dalla notifica all&rsquo;interessato.<\\/span><\\/p>\\n<p>&nbsp;<\\/p>\",\"preview\":true,\"conditioned\":false,\"connected_to\":\"\",\"show_on\":\"\",\"visible\":true,\"required\":false,\"show_in_table\":false,\"label_table\":\"\",\"show_in_export\":false,\"label_export\":\"\",\"layout_alignment\":\"right\",\"id\":1670856263825},{\"type\":\"answer_text_editor\",\"label\":\"Compilabile\",\"icon\":\"<i class=\'fa fa-edit\'><\\/i>\",\"question\":\"\",\"tooltip\":\"\",\"answer\":\"<p>&nbsp;<\\/p>\\n<table style=\\\"border-collapse: collapse; width: 100%; border-style: none;\\\" border=\\\"0\\\" cellpadding=\\\"4\\\">\\n<tbody>\\n<tr>\\n<td style=\\\"width: 50%;\\\">Torino, <span style=\\\"background-color: #f1c40f;\\\">DATA provvedimento<\\/span><\\/td>\\n<td style=\\\"width: 50%; text-align: right;\\\">\\n<div>p. il PREFETTO<\\/div>\\n<div><span style=\\\"background-color: #f1c40f;\\\">(nome dirigente area IV)<\\/span><\\/div>\\n<\\/td>\\n<\\/tr>\\n<\\/tbody>\\n<\\/table>\\n<p>&nbsp;<\\/p>\",\"preview\":true,\"conditioned\":false,\"connected_to\":\"\",\"show_on\":\"\",\"visible\":true,\"required\":false,\"show_in_table\":false,\"label_table\":\"\",\"show_in_export\":false,\"label_export\":\"\",\"layout_alignment\":\"right\",\"id\":1667745522891},{\"type\":\"fixed_text\",\"label\":\"Testo fisso\",\"icon\":\"<i class=\'fa fa-align-left\'><\\/i>\",\"value\":\"<div><span style=\\\"font-size: 10pt;\\\">Alla Questura di Torino per la traduzione, la notifica e gli adempimenti di competenza<\\/span><\\/div>\\n<div><span style=\\\"font-size: 10pt;\\\">Alla Struttura di Accoglienza {{ente_denominazione}}<\\/span><\\/div>\\n<div><span style=\\\"font-size: 10pt;\\\">Alla Commissione Territoriale per il riconoscimento della protezione internazionale<\\/span><\\/div>\\n<div><span style=\\\"font-size: 10pt;\\\">Alle Prefetture e alle Questure della Repubblica<\\/span><\\/div>\\n<div><span style=\\\"font-size: 10pt;\\\">All\'Angrafe del Comune di {{struttura_comune}} <\\/span><\\/div>\",\"preview\":true,\"conditioned\":false,\"connected_to\":\"\",\"show_on\":\"\",\"visible\":true,\"show_in_table\":false,\"label_table\":\"\",\"show_in_export\":false,\"label_export\":\"\",\"layout_alignment\":\"right\",\"id\":1667745643446}]}', '#e2fe7f', '', 0, '2023-01-04 12:43:35', '2023-01-04 12:43:35'),
