ign: left;\\\">Al sig. {{ospite_cognome}} {{ospite_nome}}<\\/td>\\n<\\/tr>\\n<tr>\\n<td style=\\\"width: 40%;\\\">&nbsp;<\\/td>\\n<td style=\\\"width: 10%; vertical-align: top; text-align: right;\\\">&nbsp;<\\/td>\\n<td style=\\\"width: 50%; text-align: left;\\\">Vestanet {{ospite_vestanet}}, CUI {{ospite_cui}}<\\/td>\\n<\\/tr>\\n<tr>\\n<td style=\\\"width: 40%;\\\">&nbsp;<\\/td>\\n<td style=\\\"width: 10%; text-align: right;\\\">e, p.c<\\/td>\\n<td style=\\\"width: 50%; text-align: left;\\\">\\n<div>All\'ente gestore {{ente_denominazione}}<br \\/>{{struttura_indirizzo}}<\\/div>\\n<div>{{struttura_email}}<\\/div>\\n<div>{{ente_email}}<\\/div>\\n<\\/td>\\n<\\/tr>\\n<tr>\\n<td style=\\\"width: 40%;\\\">&nbsp;<\\/td>\\n<td style=\\\"width: 10%;\\\">&nbsp;<\\/td>\\n<td style=\\\"width: 50%; text-align: left;\\\">Al Dirigente del Servizio I<\\/td>\\n<\\/tr>\\n<tr>\\n<td style=\\\"width: 40%;\\\">&nbsp;<\\/td>\\n<td style=\\\"width: 10%;\\\">&nbsp;<\\/td>\\n<td style=\\\"width: 50%; text-align: left;\\\"><span style=\\\"background-color: #f1c40f;\\\">Alle Questure e alle Prefetture della Repubblica<\\/span><\\/td>\\n<\\/tr>\\n<tr>\\n<td style=\\\"width: 40%;\\\">&nbsp;<\\/td>\\n<td style=\\\"width: 10%;\\\">&nbsp;<\\/td>\\n<td style=\\\"width: 50%; text-align: left;\\\">All\'Anagrafe del Comune di {{struttura_comune}}<\\/td>\\n<\\/tr>\\n<\\/tbody>\\n<\\/table>\",\"preview\":true,\"conditioned\":false,\"connected_to\":\"\",\"show_on\":\"\",\"visible\":true,\"required\":false,\"show_in_table\":false,\"label_table\":\"\",\"show_in_export\":false,\"label_export\":\"\",\"layout_alignment\":\"right\",\"id\":1672831742155},{\"type\":\"answer_text_editor\",\"label\":\"Compilabile\",\"icon\":\"<i class=\'fa fa-edit\'><\\/i>\",\"question\":\"\",\"tooltip\":\"\",\"answer\":\"<div>OGGETTO: Sig. {{ospite_cognome}} {{ospite_nome}}, nato il {{ospite_data_nascita}} in {{ospite_luogo_nascita}}, Vestanet{{ospite_vestanet}}, CUI {{ospite_cui}}<\\/div>\\n<div><strong>Cessazione delle misure di accoglienza<\\/strong><\\/div>\\n<div>&nbsp;<\\/div>\\n<div>\\n<p class=\\\"MsoNormal\\\" style=\\\"text-indent: 35.4pt;\\\"><span style=\\\"font-family: times new roman, times, serif;\\\"><span style=\\\"font-size: 12pt;\\\">Atteso che la S.V. ha <a style=\\\"mso-comment-reference: \'BMS\\\\(_1\'; mso-comment-date: 20211223T0852;\\\">avuto lo status di rifugiato con decreto dalla Commissione Territoriale per la Protezione Internazionale di Torino <span style=\\\"background-color: #f1c40f;\\\">(DATA)<\\/span>, essendo stata rifiutata la sua candidatura dal sistema SAI per mancanza dei necessari requisiti di integrazione, sono venuti meno i requisiti per il mantenimento delle misure di accoglienza a Suo favore.<\\/a><\\/span><\\/span><\\/p>\\n<p class=\\\"MsoNormal\\\" style=\\\"text-indent: 35.4pt;\\\"><span style=\\\"font-family: times new roman, times, serif; background-color: #f1c40f;\\\"><span style=\\\"font-size: 12pt; background-color: #f1c40f;\\\">OPPURE<\\/span><\\/span><\\/p>\\n<p class=\\\"MsoNormal\\\" style=\\\"text-indent: 35.4pt;\\\"><span style=\\\"font-family: times new roman, times, serif;\\\">&nbsp; <span style=\\\"font-size: 12pt;\\\"> Si informa la S.V. che, avendo rinunciato all&rsquo;inserimento in un progetto SAI gestito dal Comune <span style=\\\"background: #f1c40f;\\\">COMUNE DI DESTINAZIONE PROPOSTO<\\/span>, pur avendone i requisiti, sono venute meno le condizioni per permanere nella struttura di accoglienza per scadenza dei tempi di permanenza <\\/span><\\/span><\\/p>\\n<p class=\\\"MsoNormal\\\" style=\\\"text-indent: 35.4pt;\\\"><span style=\\\"font-family: times new roman, times, serif; background-color: #f1c40f;\\\"><span style=\\\"font-size: 12pt; background-color: #f1c40f;\\\">OPPURE<\\/span><\\/span><\\/p>\\n<p class=\\\"MsoNormal\\\" style=\\\"text-indent: 35.4pt;\\\"><span style=\\\"font-family: times new roman, times, serif;\\\"><span style=\\\"font-size: 12pt;\\\">Atteso che la S.V. <span style=\\\"background-color: #f1c40f;\\\">ha ricevuto l&rsquo;esito negativo da parte dell\'autorit&agrave; giudiziaria avvero il provvedimento della Commissione\\/Tribunale\\/<\\/span><\\/span><span style=\\\"font-size: 12pt;\\\"><span style=\\\"background-color: #f1c40f;\\\"> di <\\/span><span style=\\\"background: yellow; mso-highlight: yellow;\\\">i<span style=\\\"background-color: #f1c40f;\\\">nammissibilit&agrave; del ricorso presentato alla Corte di Cassazione avverso il rigetto del Tribunale di Torino\\/ il rigetto del ricorso da parte della Tribunale di Torino<\\/span><\\/span><span style=\\\"background-color: #f1c40f;\\\">, senza che sia stata presentato ricorso in Corte di Cassazione<\\/span>, si comunica che sono venuti meno i requisiti per il mantenimento delle misure di accoglienza a Suo favore<\\/span><\\/span><\\/p>\\n<p class=\\\"MsoNormal\\\" style=\\\"text-indent: 35.4pt;\\\"><span style=\\\"font-family: times new roman, times, serif;\\\"><!-- [if gte mso 9]><xml>\\n <o:OfficeDocumentSettings>\\n  <o:AllowPNG\\/>\\n <\\/o:OfficeDocumentSettings>\\n<\\/xml><![endif]--><!-- [if gte mso 9]><xml>\\n <w:WordDocument>\\n  <w:View>Normal<\\/w:View>\\n  <w:Zoom>0<\\/w:Zoom>\\n  <w:TrackMoves\\/>\\n  <w:TrackFormatting\\/>\\n  <w:HyphenationZone>14<\\/w:HyphenationZone>\\n  <w:PunctuationKerning\\/>\\n  <w:ValidateAgainstSchemas\\/>\\n  <w:SaveIfXMLInvalid>false<\\/w:SaveIfXMLInvalid>\\n  <w:IgnoreMixedContent>false<\\/w:IgnoreMixedContent>\\n  <w:AlwaysShowPlaceholderText>false<\\/w:AlwaysShowPlaceholderText>\\n  <w:DoNotPromoteQF\\/>\\n  <w:LidThemeOther>IT<\\/w:LidThemeOther>\\n  <w:LidThemeAsian>X-NONE<\\/w:LidThemeAsian>\\n  <w:LidThemeComplexScript>X-NONE<\\/w:LidThemeComplexScript>\\n  <w:Compatibility>\\n   <w:BreakWrappedTables\\/>\\n   <w:SnapToGridInCell\\/>\\n   <w:WrapTextWithPunct\\/>\\n   <w:UseAsianBreakRules\\/>\\n   <w:DontGrowAutofit\\/>\\n   <w:SplitPgBreakAndParaMark\\/>\\n   <w:EnableOpenTypeKerning\\/>\\n   <w:DontFlipMirrorIndents\\/>\\n   <w:OverrideTableStyleHps\\/>